SELECT CAST(EXTRACT(YEAR FROM "Generico_5"."FECHA") AS BIGINT) AS "yr:FECHA:ok" FROM "Generico_5" WHERE ((CAST(EXTRACT(YEAR FROM "Generico_5"."FECHA") AS BIGINT) >= 2010) AND (CAST(EXTRACT(YEAR FROM "Generico_5"."FECHA") AS BIGINT) <= 2015) AND ("Generico_5"."Anunciante" IN ('BANTRAB/TODOTICKET', 'TODOTICKET', 'TODOTICKET.COM')) AND (((CAST(EXTRACT(MONTH FROM "Generico_5"."FECHA") AS BIGINT) >= 1) AND (CAST(EXTRACT(MONTH FROM "Generico_5"."FECHA") AS BIGINT) <= 7)) OR (CAST(EXTRACT(MONTH FROM "Generico_5"."FECHA") AS BIGINT) IS NULL))) GROUP BY "yr:FECHA:ok";
